import React from 'react';
import { Nav, NavTitle } from '../style/global'
import { Navigate } from 'react-router-dom';


const Navbar = (props) => {
    const navigate = Navigate();
    return(<Nav>
        <NavTitle onClick={Navigate("/")}>JM BLOG</NavTitle>
    </Nav>);
}

export default Navbar;
